import { gql } from "@apollo/client";

export const LOAD_USERS = gql`
  query {
    getAllUsers {
      id
      Name
      email
      designation
      experience
    }
  }
`;



export const CREATE_USER_MUTATION = gql`
  mutation createUser(
    $Name: String!
    $email: String!
    $designation: String
    $experience:String
  ) {
    createUser(
      Name: $Name
      email: $email
      designation: $designation
      experience:$experience
    ) {
      id
    }
  }
`;
